import React,{useEffect} from 'react'
import Aos from 'aos';
import 'aos/dist/aos.css';
import vdo from '../images/mangoachar.mp4';


const About = () => {
    useEffect(() => {

        Aos.init({duration:2000});
    }, [])
    return (
        <>
          <div className="grid-all">
            <div className="grids">
                <div data-aos="fade-up" className="box">1</div>
                <div data-aos="slide-right" className="box">2</div>
            </div>
            <div className="grids">

                <div data-aos="fade-up" className="box1">
                   <video autoPlay loop muted height="240px" width="480px" controls>
                       <source src={vdo} type="video/mp4"/>
                   </video>
                </div>
                <div data-aos="slide-right" className="box">4</div>
            </div>
            <div className="grids">
                <div data-aos="fade-up" className="box">5</div>
                <div data-aos="slide-right" className="box">6</div>
            </div>

          </div>

        </>
    )
}

export default About
